import './App.css';

function App() {
  return (
    <div className="bg-blend-lighten hover:bg-blend-darken">
       <div className="bg-gradient-to-r from-green-400 to-blue-500 p-6 rounded-lg shadow-xl">
        <h1 className="text-3xl font-bold text-white">Hello World</h1>
        <p className="text-white">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam nec purus nec nunc.</p>
      </div>
    </div>
  );
}

export default App;
